function UserList({ userData }){

    const userCards = userData.map((user)=> {
        const {firstname, lastname, reviews} = user;
            const eachReview = reviews.ratings.map((rating)=> {
                const {dish_name, cuisine, dish_size, score} = rating;
                return (
                    <>
                        <p>{dish_name}</p>
                        <p>{cuisine}</p>
                        <p>{dish_size}</p>
                        <p>{score}</p>
                    </>
                )
            })

        return (
            <div>
                <h3>{firstname} {lastname} </h3>
                <p>{eachReview}</p>
            </div>
        )
    })

    return (
        <>
            {userCards}
        </>
    )

}

export default UserList
